import React, { useEffect, useState } from 'react';
import styles from './Home.module.scss';
import useHomeStore from '../../stores/homeStore';
import { NavLink } from 'react-router-dom';



const Home = () => {
    const [searchQuery, setSearchQuery] = useState('');
    const getTestIcons = useHomeStore(state => state.getTests);
    const tests = useHomeStore(state => state.tests);

    const handleSearchChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        setSearchQuery(e.target.value);
    };

    useEffect(() => {
        getTestIcons();
    }, [])

    return (
        <div className={styles.main}>
            <header className={styles.header}>
                <input
                    type="text"
                    className={styles.searchInput}
                    placeholder="&#x1F50E;&#xFE0E; Search for tests..."
                    value={searchQuery}
                    onChange={(e) => handleSearchChange(e)}
                />
            </header>
            {tests ? <>

                <h1>Some tests for you :D</h1>

                <ul className={styles.testList}>
                    {tests.map(test => (
                        <NavLink className={styles.navLink} to={`/test/${test._id}`}>
                            <li key={test._id} className={styles.testItem}>
                                <h2 className={styles.testTitle}>{test.name}</h2>
                                <p className={styles.testDescription}>{test.description}</p>
                            </li>
                        </NavLink>
                    ))}
                </ul>
            </> : <ul className={styles.testList}><li className={styles.testItem}><h1 style={{ fontSize: '2rem' }} className={styles.testTitle}>Loading...</h1></li></ul>

            }
        </div>
    );
};

export default Home;
